import React, { useEffect, useState } from "react";
import API from "../api/api";
import { useSelector } from "react-redux";

export default function ManagerDashboard() {
  const auth = useSelector((state) => state.auth);
  const [mode, setMode] = useState("today"); // "today" or "all"
  const [records, setRecords] = useState([]);

  // Format date/time
  const formatDate = (d) => (d ? new Date(d).toLocaleDateString() : "-");
  const formatTime = (d) => (d ? new Date(d).toLocaleTimeString() : "-");

  // Load today's attendance
  const loadToday = async () => {
    const res = await API.get("/attendance/all-today");
    setRecords(res.data);
  };

  // Load all records
  const loadAll = async () => {
    const res = await API.get("/attendance/all");
    setRecords(res.data);
  };

  useEffect(() => {
    if (mode === "today") loadToday();
    else loadAll();
  }, [mode]);


  return (
    <div className="container">
      <h2>Manager Dashboard</h2>
      <h3>Welcome, {auth?.user?.name}</h3>

      <button className="btn btn-primary" onClick={() => setMode("today")}>
        Todayâ€™s Report
      </button>

      <button className="btn btn-secondary" onClick={() => setMode("all")}>
        All Records
      </button>

      <h3>{mode === "today" ? "Today's Attendance" : "All Attendance Records"}</h3>

      <table className="table">
        <thead>
          <tr>
            <th>Name</th>
            <th>Employee ID</th>
            <th>Date</th>
            <th>Check-in</th>
            <th>Check-out</th>
            <th>Hours</th>
            <th>Status</th>
          </tr>
        </thead>

        <tbody>
          {records.length === 0 ? (
            <tr>
              <td colSpan="7">No Records</td>
            </tr>
          ) : (
            records.map((r) => (
              <tr key={r._id || r.employeeId}>
                <td>{r.name || r?.userId?.name}</td>
                <td>{r.employeeId || r?.userId?.employeeId}</td>
                <td>{formatDate(r.date || r?.attendance?.date)}</td>
                <td>{formatTime(r.checkInTime || r?.attendance?.checkInTime)}</td>
                <td>{formatTime(r.checkOutTime || r?.attendance?.checkOutTime)}</td>
                <td>{r.totalHours || r?.attendance?.totalHours || "-"}</td>
                <td>{r.status || (r.attendance ? "present" : "absent")}</td>
              </tr>
            ))
          )}
        </tbody>
      </table>
    </div>
  );
}
